// this is used in skills page 
// we make array of objects 
const data=[
    {
        name:'Full stact web development ',
        image:'images/web development.jpeg'         //by this we get the image from 
    },
    {
        name:'C programming Language ',
        image:'../images/c language.jpeg'
    },
    {
        name:'C++ programming Language  ',
        image:'../images/c++.jpeg'
    },
    {
        name:'Python programming Language ',
        image:'../images/python.jpeg'
    },
    {
        name:'Flask framework in python',
        image:'../images/flask.png'
    }
]

export default data;
